Creation_tips1:
“HD 복원”은 현재 활성화할 수 없습니다. 다음 설정을 확인하십시오:
1. “이미지에서 이미지” 모듈에 이미지를 업로드했습니다;
2. “모드”가 “기본값”이 아닌 다른 것으로 선택되었습니다;
3. “컨트롤 넷”이 추가되었습니다;
위 설정을 취소하고 다시 시도해 주세요.

